siEx cO3::clsInvoke(iScr* pthis, iCtx* ctx, int index, int argc,
           const Var* argv, Var* rval)
{
      siEx ex;
      cO3* pthis1 = (cO3*) pthis;

      switch(index) {
         case 0:
            *rval = pthis1->m_onapprove;
            break;
         case 1:
            pthis1->m_onapprove = argv[0].toScr();
            break;
         case 2:
            *rval = pthis1->m_ondone;
            break;
         case 3:
            pthis1->m_ondone = argv[0].toScr();
            break;
         case 4:
            *rval = pthis1->m_onprogress;
            break;
         case 5:
            pthis1->m_onprogress = argv[0].toScr();
            break;
         case 6:
            *rval = pthis1->m_onfail;
            break;
         case 7:
            pthis1->m_onfail = argv[0].toScr();
            break;
         case 8:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( doInstall )");
            pthis1->doInstall();
            break;
         case 9:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( args )");
            *rval = o3_new(tScrVec<Str>)(pthis1->args());
            break;
         case 10:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( envs )");
            *rval = o3_new(tScrVec<Str>)(pthis1->envs());
            break;
         case 11:
            if (argc > 1)
               return o3_new(cEx)("Invalid argument count. ( wait )");
            pthis1->wait(ctx,argc > 0 ? argv[0].toInt32() : -1);
            break;
         case 12:
            if (argc > 1)
               return o3_new(cEx)("Invalid argument count. ( exit )");
            pthis1->exit(argc > 0 ? argv[0].toInt32() : 0);
            break;
         case 13:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( versionInfo )");
            *rval = pthis1->versionInfo();
            break;
         case 14:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( settings )");
            *rval = pthis1->settings(ctx);
            break;
         case 15:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( setSettings )");
            *rval = pthis1->setSettings(ctx,argv[0].toStr(),&ex);
            break;
         case 16:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( settingsURL )");
            *rval = pthis1->settingsURL();
            break;
         case 17:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( require )");
            pthis1->require(ctx,argv[0].toStr());
            break;
         case 18:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( loadModules )");
            pthis1->loadModules(ctx);
            break;
         case 19:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( setOnUpdateNotification )");
            *rval = pthis1->setOnUpdateNotification(ctx,argv[0].toScr());
            break;
         case 20:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( settingsDir )");
            *rval = siFs(pthis1->settingsDir(ctx));
            break;
         case 21:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( approvalURL )");
            *rval = pthis1->approvalURL();
            break;
         case 22:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( onupdate )");
            *rval = pthis1->onupdate();
            break;
         case 23:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( setOnupdate )");
            *rval = pthis1->setOnupdate(ctx,argv[0].toScr());
            break;
         case 24:
            if (argc != 0)
               return o3_new(cEx)("Invalid argument count. ( oninstall )");
            *rval = pthis1->oninstall();
            break;
         case 25:
            if (argc != 1)
               return o3_new(cEx)("Invalid argument count. ( setOninstall )");
            *rval = pthis1->setOninstall(ctx,argv[0].toScr());
            break;
      }
      return ex;
}

